def get_app_icon():
    """Load application icon from base64 data with fallback"""
    try:
        if ICON_DATA.strip():
            icon_data = base64.b64decode(ICON_DATA)
            pixmap = QPixmap()
            pixmap.loadFromData(QByteArray(icon_data))
            icon = QIcon(pixmap)
            if not icon.isNull():
                return icon
    except Exception:
        pass
    
    # Create a simple fallback icon if base64 fails
    return create_simple_icon()

def get_github_icon():
    """Load GitHub icon from base64 data with fallback"""
    try:
        if GITHUB_ICON_DATA.strip():
            icon_data = base64.b64decode(GITHUB_ICON_DATA)
            pixmap = QPixmap()
            pixmap.loadFromData(QByteArray(icon_data))
            if not pixmap.isNull():
                # Scale to 20x20 pixels
                scaled_pixmap = pixmap.scaled(20, 20, Qt.AspectRatioMode.KeepAspectRatio, Qt.TransformationMode.SmoothTransformation)
                return scaled_pixmap
    except Exception:
        pass
    
    # Return None if base64 fails - will use Unicode fallback
    return None

def create_simple_icon():
    """Create a simple programmatic icon as fallback"""
    pixmap = QPixmap(32, 32)
    pixmap.fill(Qt.GlobalColor.transparent)
    
    painter = QPainter(pixmap)
    painter.setRenderHint(QPainter.RenderHint.Antialiasing)
    
    # Draw a simple circle with "2F" text
    painter.setBrush(QBrush(QColor(40, 167, 69)))  # Green color matching your theme
    painter.setPen(Qt.PenStyle.NoPen)
    painter.drawEllipse(2, 2, 28, 28)
    
    # Draw "2F" text
    painter.setPen(QColor(255, 255, 255))
    font = painter.font()
    font.setPointSize(12)
    font.setBold(True)
    painter.setFont(font)
    painter.drawText(pixmap.rect(), Qt.AlignmentFlag.AlignCenter, "2F")
    
    painter.end()
    return QIcon(pixmap)


class ClickableLabel(QLabel):
    """Custom QLabel that can handle mouse clicks for hyperlinks"""
    def __init__(self, text="", url=""):
        super().__init__(text)
        self.url = url
        if url:
            self.setCursor(QCursor(Qt.CursorShape.PointingHandCursor))
    
    def mousePressEvent(self, event):
        if event.button() == Qt.MouseButton.LeftButton and self.url:
            QDesktopServices.openUrl(QUrl(self.url))
        super().mousePressEvent(event)


class DecryptionWorker(QThread):
    """Worker thread for decryption to prevent UI freezing"""
    finished = pyqtSignal(object)  # Changed from dict to object to handle both dict and list
    error = pyqtSignal(str)
    progress = pyqtSignal(int)

    def __init__(self, backup_path: str, passphrase: str):
        super().__init__()
        self.backup_path = backup_path
        self.passphrase = passphrase

    def run(self):
        try:
            self.progress.emit(10)
            
            # Load backup file
            with open(self.backup_path, 'r', encoding='utf-8') as f:
                data = json.load(f)
            
            self.progress.emit(30)
            
            # Extract encrypted data
            services_enc = data.get("servicesEncrypted")
            if not services_enc:
                raise ValueError("Invalid backup file: missing 'servicesEncrypted' field")
            
            # Decode base64 components
            parts = services_enc.split(":")
            if len(parts) != 3:
                raise ValueError("Invalid encrypted data format")
            
            credentials_enc, pbkdf2_salt, nonce = map(base64.b64decode, parts)
            
            self.progress.emit(60)
            
            # Derive key using PBKDF2
            kdf = PBKDF2HMAC(
                algorithm=SHA256(),
                length=32,
                salt=pbkdf2_salt,
                iterations=10000
            )
            key = kdf.derive(self.passphrase.encode("utf-8"))
            
            self.progress.emit(80)
            
            # Decrypt data
            aesgcm = AESGCM(key)
            credentials_dec = aesgcm.decrypt(nonce, credentials_enc, None)
            credentials_json = json.loads(credentials_dec)
            
            self.progress.emit(100)
            self.finished.emit(credentials_json)
            
        except Exception as e:
            self.error.emit(str(e))


class DropZoneWidget(QFrame):
    """Custom widget for drag and drop file handling"""
    fileDropped = pyqtSignal(str)

    def __init__(self):
        super().__init__()
        self.setAcceptDrops(True)
        self.setupUI()

    def setupUI(self):
        self.setStyleSheet("""
            DropZoneWidget {
                border: 3px dashed #28a745;
                border-radius: 12px;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(40, 167, 69, 0.1),
                    stop:1 rgba(40, 167, 69, 0.05));
                min-height: 160px;
            }
            DropZoneWidget:hover {
                border-color: #218838;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(33, 136, 56, 0.15),
                    stop:1 rgba(33, 136, 56, 0.08));
            }
        """)

        layout = QVBoxLayout()
        layout.setAlignment(Qt.AlignmentFlag.AlignCenter)

        # Drop icon (using Unicode)
        self.icon_label = QLabel("📁")
        self.icon_label.setAlignment(Qt.AlignmentFlag.AlignCenter)
        self.icon_label.setStyleSheet("font-size: 64px; color: #28a745; margin: 15px;")

        # Drop text - changed color from #666 to white
        self.text_label = QLabel("Drop your .2fas backup file here\nor click to browse")
        self.text_label.setAlignment(Qt.AlignmentFlag.AlignCenter)
        self.text_label.setStyleSheet("""
            color: #ffffff;
            font-size: 16px;
            font-weight: 500;
            line-height: 1.5;
            margin: 10px;
        """)

        layout.addWidget(self.icon_label)
        layout.addWidget(self.text_label)
        self.setLayout(layout)

    def dragEnterEvent(self, event: QDragEnterEvent):
        if event.mimeData().hasUrls():
            urls = event.mimeData().urls()
            if urls and self.is_valid_file(urls[0].toLocalFile()):
                event.acceptProposedAction()
                # Use green highlight for valid files
                self.setStyleSheet("""
                    DropZoneWidget {
                        border: 3px dashed #218838;
                        border-radius: 12px;
                        background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                            stop:0 rgba(33, 136, 56, 0.2),
                            stop:1 rgba(33, 136, 56, 0.1));
                        min-height: 160px;
                    }
                """)
            else:
                # Accept the drag event but show error state for invalid files
                event.acceptProposedAction()
                self.show_error_state_during_drag()
        else:
            event.ignore()

    def dragLeaveEvent(self, event):
        # Reset to normal green state when drag leaves
        self.reset_to_normal_state_without_timer()

    def dropEvent(self, event: QDropEvent):
        urls = event.mimeData().urls()
        if urls:
            file_path = urls[0].toLocalFile()
            if self.is_valid_file(file_path):
                self.fileDropped.emit(file_path)
                event.acceptProposedAction()
                # Reset to normal state
                self.reset_to_normal_state()
            else:
                # Show error message and start countdown timer only on drop (release)
                event.acceptProposedAction()
                self.show_error_message_with_timer()

    def show_error_state_during_drag(self):
        """Show error state while dragging invalid file (no timer)"""
        self.icon_label.setText("❌")
        self.icon_label.setStyleSheet("font-size: 64px; color: #dc3545; margin: 15px;")
        self.text_label.setText("Pls. drop or browse only .2fas files.")
        self.text_label.setStyleSheet("""
            color: #dc3545;
            font-size: 16px;
            font-weight: 600;
            line-height: 1.5;
            margin: 10px;
        """)
        
        # Change border color to red
        self.setStyleSheet("""
            DropZoneWidget {
                border: 3px dashed #dc3545;
                border-radius: 12px;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(220, 53, 69, 0.1),
                    stop:1 rgba(220, 53, 69, 0.05));
                min-height: 160px;
            }
        """)

    def show_error_message_with_timer(self):
        """Show error message with 3-second timer (only called on drop/release)"""
        self.icon_label.setText("❌")
        self.icon_label.setStyleSheet("font-size: 64px; color: #dc3545; margin: 15px;")
        self.text_label.setText("Pls. drop or browse only .2fas files.")
        self.text_label.setStyleSheet("""
            color: #dc3545;
            font-size: 16px;
            font-weight: 600;
            line-height: 1.5;
            margin: 10px;
        """)
        
        # Change border color to red
        self.setStyleSheet("""
            DropZoneWidget {
                border: 3px dashed #dc3545;
                border-radius: 12px;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(220, 53, 69, 0.1),
                    stop:1 rgba(220, 53, 69, 0.05));
                min-height: 160px;
            }
        """)
        
        # Start 3-second timer to reset to normal state
        from PyQt6.QtCore import QTimer
        QTimer.singleShot(3000, self.reset_to_normal_state)

    def reset_to_normal_state(self):
        """Reset the drop zone to normal state"""
        self.icon_label.setText("📁")
        self.icon_label.setStyleSheet("font-size: 64px; color: #28a745; margin: 15px;")
        self.text_label.setText("Drop your .2fas backup file here\nor click to browse")
        self.text_label.setStyleSheet("""
            color: #ffffff;
            font-size: 16px;
            font-weight: 500;
            line-height: 1.5;
            margin: 10px;
        """)
        
        # Reset border color to green
        self.setStyleSheet("""
            DropZoneWidget {
                border: 3px dashed #28a745;
                border-radius: 12px;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(40, 167, 69, 0.1),
                    stop:1 rgba(40, 167, 69, 0.05));
                min-height: 160px;
            }
            DropZoneWidget:hover {
                border-color: #218838;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(33, 136, 56, 0.15),
                    stop:1 rgba(33, 136, 56, 0.08));
            }
        """)

    def reset_to_normal_state_without_timer(self):
        """Reset the drop zone to normal state without timer"""
        self.icon_label.setText("📁")
        self.icon_label.setStyleSheet("font-size: 64px; color: #28a745; margin: 15px;")
        self.text_label.setText("Drop your .2fas backup file here\nor click to browse")
        self.text_label.setStyleSheet("""
            color: #ffffff;
            font-size: 16px;
            font-weight: 500;
            line-height: 1.5;
            margin: 10px;
        """)
        
        # Reset border color to green
        self.setStyleSheet("""
            DropZoneWidget {
                border: 3px dashed #28a745;
                border-radius: 12px;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(40, 167, 69, 0.1),
                    stop:1 rgba(40, 167, 69, 0.05));
                min-height: 160px;
            }
            DropZoneWidget:hover {
                border-color: #218838;
                background: qlineargradient(x1:0, y1:0, x2:0, y2:1,
                    stop:0 rgba(33, 136, 56, 0.15),
                    stop:1 rgba(33, 136, 56, 0.08));
            }
        """)

    def is_valid_file(self, file_path: str) -> bool:
        """Validate file extension using regex"""
        pattern = r'\.2fas$'
        return bool(re.search(pattern, file_path, re.IGNORECASE))

    def mousePressEvent(self, event):
        if event.button() == Qt.MouseButton.LeftButton:
            self.browse_file()

    def browse_file(self):
        file_path, _ = QFileDialog.getOpenFileName(
            self, "Select 2FAS Backup File", "",
            "2FAS Backup Files (*.2fas);;All Files (*)"
        )
        if file_path:
            if self.is_valid_file(file_path):
                self.fileDropped.emit(file_path)
                self.reset_to_normal_state()
            else:
                # Show error message for invalid file selected via browse
                self.show_error_message_with_timer()


